import web from '../src/img/envelope.png';
import cd1 from '../src/img/1.jpg';
import cd2 from '../src/img/2.jpg';
import cd3 from '../src/img/3.jpg';
import cd4 from '../src/img/4.jpg';
import cd5 from '../src/img/5.jpg';

const Data = [
    {
        imgsrc: web,
        title: "First Card",
    },
    {
        imgsrc: cd1,
        title: "Second Card",
    },
    {
        imgsrc: cd2,
        title: "Third Card",
    },
    {
        imgsrc: cd3,
        title: "Fourth Card",
    },
    {
        imgsrc: cd4,
        title: "Five Card",
    },
    {
        imgsrc: cd5,
        title: "six Card",
    },
    {
        imgsrc: cd3,
        title: "First Card",
    },
]

export default Data;
